export { default } from "./Entry";

export type FormField = {
  label: string;
  type: "text" | "email" | "password";
};

export const LoginFields: FormField[] = [
  {
    label: "Email",
    type: "email",
  },
  {
    label: "Password",
    type: "password",
  },
];

export const RegisterFields: FormField[] = [
  {
    label: "Full Name",
    type: "text",
  },
  {
    label: "Email",
    type: "email",
  },
  {
    label: "Password",
    type: "password",
  },
  {
    label: "Confirm Password",
    type: "password",
  },
];
